package org.ilmostro.basic.leetcode.pigeonhole;

import java.util.HashMap;
import java.util.Map;

/**
 * 在字符串 s 中找出第一个只出现一次的字符。如果没有，返回一个单空格。 s 只包含小写字母。
 *
 * @author li.bowei
 * @link {https://leetcode-cn.com/problems/di-yi-ge-zhi-chu-xian-yi-ci-de-zi-fu-lcof/}
 */
public class Solution42 {

    public static void main(String[] args) {
        char leetcode = new Solution42().firstUniqChar("");
        System.out.println(leetcode);
    }

    public char firstUniqChar(String s) {
        if (s == null || s.length() <= 0) {
            return ' ';
        }
        int[] word = new int[26];
        for (int i = 0; i < s.toCharArray().length; i++) {
            word[s.charAt(i) - 97]++;
        }
        for (int i = 0; i < s.toCharArray().length; i++) {
            if (word[s.charAt(i) - 97] == 1) {
                return s.charAt(i);
            }
        }
        return ' ';
    }

    public char firstUniqCharHash(String s) {
        if (s == null || s.length() <= 0) {
            return ' ';
        }
        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            map.merge(s.charAt(i), 1, Integer::sum);
        }
        for (int i = 0; i < s.length(); i++) {
            if (map.get(s.charAt(i)) == 1) {
                return s.charAt(i);
            }
        }
        return ' ';
    }
}
